import AppBar from "./components/AppBar";
import {BrowserRouter, Navigate, Route, Routes} from "react-router-dom";
import Home from "./pages/Home";


function App() {
  return (
    <div className="App">
        <BrowserRouter>
            <AppBar/>
            <Routes>
                <Route path={'/'} element = {<Home/>}/>
                <Navigate replace to={'/'}/>
            </Routes>
        </BrowserRouter>

    </div>
  );
}

export default App;
